const Card =() => {
	return(

		<div> 
			<h1>RoboFriends</h1>
			<img alt='robots' src='https://robohash.org/random ? 200x200'/>
			<div>
				<h2>Jane Doe</h2>
				<p>jane.doe@gmail.com</p>
			</div>
		</div>
		);
}

export default Card;
